from asyncio import tasks
import re
from typing import List
import collections


class Solution:
    def leastInterval(self, tasks: List[str], n: int) -> int:
        # type_count = collections.Counter(tasks)

        # 统计任务种类数量和每种任务需要执行的次数
        type_count_dict = {}
        for each in tasks:
            if each in type_count_dict:
                type_count_dict[each] += 1
            else:
                type_count_dict[each] = 1

        # 任务种类数量
        num_type = len(type_count_dict)
        # 初始化任务可以执行的时间
        excute_time = [1] * num_type
        # 任务需要执行的剩余次数
        remain_count = list(type_count_dict.values())

        num_tasks = len(tasks)
        time = 0
        # while sum(remain_count) != 0:
        # for i in range(len(tasks)):
        while num_tasks:

            time += 1
            # 最近能够执行的任务时间
            min_excute_time = min([excute_time[_] for _ in range(num_type) if remain_count[_] > 0])
            time = max(time, min_excute_time)

            # 下一个执行的任务为
            # 不在冷却中，且剩余执行次数最多的任务
            best = -1
            for i in range(num_type):
                if remain_count[i] != 0 and excute_time[i] <= time:  # 不在冷却中的任务
                    # 进入这里都为不在冷却中的任务
                    # 因为time取了最大值，因此这里一定有任务
                    # best不能为-1，需要给一个初始值，最后更新为剩余执行次数最多的任务
                    if best == -1 or remain_count[best] < remain_count[i]:
                        best = i

            # 执行这个任务后要更新这个任务的下次执行时间
            excute_time[best] = time + n + 1
            # 更新剩余次数
            remain_count[best] -= 1
            num_tasks -= 1

        return time


